description:
DAMN NFO Viewer is an utility for viewing text files containing ASCII Art (e.g. .nfo files), and it proved itself to be handy... So... if you're fed up with starting some DOS-like file manager each time you need to view a .nfo file, or ain't too happy with the viewer you use, or (worst case) use Notepad - give this little tool a try.

